import React, { Component } from "react";

class Todos extends Component {
  render() {
    return (
      <div
      // style={{
      //   fontWeight: "bold",
      //   textAlign: "center",
      //   border: "red",
      //   fontSize: "30px"
      // }}
      >
        <ol>
          {this.props.allTodos.map((value, index) => {
            return <li>{value}</li>;
          })}
        </ol>
      </div>
    );
  }
}

export default Todos;
